contract Farm is ReentrancyGuard, Pausable, Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    struct StakedToken_V1 {
        address staker;
        uint256 tokenId;
    }

    struct StakedToken {
        address staker;
        uint256 tokenId;
        uint256 stackeUtx;          // Время когда застейкали
    }
    // Staker info
    struct Staker {
        uint256 amountStaked;
        StakedToken[] stakedTokens;
        uint256 timeOfLastUpdate;
        uint256 unclaimedRewards;
    }

    IERC20 public rewardsToken;
    IERC721 public nftCollection;
    address private nftCollectionAddress;
    // Rewards per hour per token deposited in wei
    uint256 public rewardsPerHour = 100000;

    uint256 public version = 3;

    bool public lockEnabled = false;      // v3
    uint256 public lockTime = 0;          // v3
    
    mapping(address => Staker) public stakers;
    // Mapping of tokenId to staker. For remember who to send back ther token
    mapping(uint256 => address) public stakerAddress;
    // Mapping of tokenId to start stake time
    mapping(uint256 => uint256) public tokenStartStakeTime;     // v3

    constructor(
        address _nftCollection,
        IERC20 _rewardsToken,
        uint256 _rewardsPerHour,
        bool _lockEnabled,         // v3
        uint _lockTime             // v3
    ) {
        nftCollection = IERC721(_nftCollection);
        nftCollectionAddress = _nftCollection;
        rewardsToken = _rewardsToken;
        rewardsPerHour = _rewardsPerHour;
        lockTime = _lockTime;           // v3
        lockEnabled = _lockEnabled;     // v3
    }
    // v3
    function setLockEnabled(bool _lockEnabled) external onlyOwner {
        lockEnabled = _lockEnabled;
    }
    // v3
    function setLockTime(uint256 _lockTime) external onlyOwner {
        lockTime = _lockTime;
    }
    function setRewardsPerHour(uint256 _rewardsPerHour) external onlyOwner {
        rewardsPerHour = _rewardsPerHour;
    }

    function _stake(address _staker, uint256 _tokenId) internal {
        require(
            nftCollection.ownerOf(_tokenId) == _staker,
            "You don't own this token!"
        );

        if (stakers[_staker].amountStaked > 0) {
            uint256 rewards = calculateRewards(_staker);
            stakers[_staker].unclaimedRewards += rewards;
        }

        nftCollection.transferFrom(_staker, address(this), _tokenId);

        StakedToken memory stakedToken = StakedToken(
            /* staker */        _staker,
            /* tokenId */       _tokenId,
            /* stackeUtx */     block.timestamp  // v3
        );
        stakers[_staker].stakedTokens.push(stakedToken);
        stakers[_staker].amountStaked++;
        stakerAddress[_tokenId] = _staker;
        tokenStartStakeTime[_tokenId] = block.timestamp;        // v3
        stakers[_staker].timeOfLastUpdate = block.timestamp;
    }

    function adminWithdrawRewards() external onlyOwner whenPaused {
        uint256 _balance = rewardsToken.balanceOf(address(this));
        rewardsToken.safeTransfer(msg.sender, _balance);
    }

    function stake(uint256 _tokenId) external nonReentrant whenNotPaused {
        _stake(msg.sender, _tokenId);
    }

    function withdraw(uint256 _tokenId) external nonReentrant {
        require(
            stakers[msg.sender].amountStaked > 0,
            "You have no tokens staked"
        );
        require(stakerAddress[_tokenId] == msg.sender, "You don't own this token!");

        require(
            (lockEnabled && ((tokenStartStakeTime[_tokenId] + lockTime) < block.timestamp)) || !lockEnabled,
            "Token lock time has not yet expired"
        );

        // Update the rewards for this user, as the amount of rewards decreases with less tokens.
        uint256 rewards = calculateRewards(msg.sender);
        stakers[msg.sender].unclaimedRewards += rewards;


        uint256 index = 0;
        for (uint256 i = 0; i < stakers[msg.sender].stakedTokens.length; i++) {
            if (
                stakers[msg.sender].stakedTokens[i].tokenId == _tokenId 
                && 
                stakers[msg.sender].stakedTokens[i].staker != address(0)
            ) {
                index = i;
                break;
            }
        }


        stakers[msg.sender].stakedTokens[index].staker = address(0);
        stakers[msg.sender].amountStaked--;
        stakerAddress[_tokenId] = address(0);
        tokenStartStakeTime[_tokenId] = 0;

        nftCollection.transferFrom(address(this), msg.sender, _tokenId);
        stakers[msg.sender].timeOfLastUpdate = block.timestamp;
    }

    function calculateRewards(address _staker)
        internal
        view
        returns (uint256 _rewards)
    {
        return (((
            ((block.timestamp - stakers[_staker].timeOfLastUpdate) *
                stakers[_staker].amountStaked)
        ) * rewardsPerHour) / 3600);
    }

    function claimRewards() external {
        uint256 rewards = calculateRewards(msg.sender) +
            stakers[msg.sender].unclaimedRewards;
        require(rewards > 0, "You have no rewards to claim");
        stakers[msg.sender].timeOfLastUpdate = block.timestamp;
        stakers[msg.sender].unclaimedRewards = 0;
        rewardsToken.safeTransfer(msg.sender, rewards);
    }

    function getStakedTokens(address _user) public view returns (StakedToken_V1[] memory) {
        StakedToken[] memory _stakedTokens = getStakedTokens_V3(_user);
        StakedToken_V1[] memory _stakedTokesV1_V2 = new StakedToken_V1[](_stakedTokens.length);
        for(uint256 k = 0; k > _stakedTokens.length; k++) {
            _stakedTokesV1_V2[k] = StakedToken_V1(
                _stakedTokens[k].staker,
                _stakedTokens[k].tokenId
            );
        }
        return _stakedTokesV1_V2;
    }
    function getStakedTokens_V3(address _user) public view returns (StakedToken[] memory) {
        if (stakers[_user].amountStaked > 0) {
            StakedToken[] memory _stakedTokens = new StakedToken[](stakers[_user].amountStaked);
            uint256 _index = 0;

            for (uint256 j = 0; j < stakers[_user].stakedTokens.length; j++) {
                if (stakers[_user].stakedTokens[j].staker != (address(0))) {
                    _stakedTokens[_index] = stakers[_user].stakedTokens[j];
                    _index++;
                }
            }

            return _stakedTokens;
        } else {
            return new StakedToken[](0);
        }
    }

    function availableRewards(address _staker) public view returns (uint256) {
        uint256 rewards = calculateRewards(_staker) +
            stakers[_staker].unclaimedRewards;
        return rewards;
    }

}

